import './App.css';
import ContactListForm from './Components/ContactListForm';

function App() {
  return (
    <div className="App">
      <header className="App-header text-center">
        <h4>Contact details</h4>
      </header>
      <BrowserRouter></BrowserRouter>
        <ContactListForm/>
    </div>
  );
}

export default App;
